import axios from "axios";

const API_BASE =  "http://localhost:8080/graph";

export const addData = (patientId,graphData) => {
    return axios.post(`${API_BASE}/add/${patientId}`,graphData);
};

export const getGraphDataById = (graphId) => {
    return axios.get(`${API_BASE}/get/${graphId}`);
};

export const getALLGraphData = () => {
    return axios.get(`${API_BASE}/getAll`);
};
